  palette: {
    primary: {
      main: '#010440',
    },
    secondary: {
      main: '#D90D32'
    }
  }
})


const App = () => {
	return (
		<div className="container">
      <Grid
        container
        direction="row"
        justifyContent="center"
        alignItems="flex-start"
      >
        <h1>N2 - Programação Web</h1><br/>
      </Grid>
        <Container sx={{ width: '75%' }}>
        <Posts />
      </Container>
		</div>
	)
}

export default App
